    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);
        input = findViewById(R.id.siteInput);
        search = findViewById(R.id.searchButton);
        result = findViewById(R.id.resultText);

        search.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                String siteId = input.getText().toString().trim().toUpperCase();
                if (siteMap.containsKey(siteId)) {
                    String coords = siteMap.get(siteId);
                    String url = "https://www.google.com/maps?q=" + coords;
                    result.setText(url);
                    Intent intent = new Intent(Intent.ACTION_VIEW, Uri.parse(url));
                    startActivity(intent);
                } else {
                    result.setText("Site ID nerastas.");
                }
            }
        });
    }
